review_text:
So, we went to Luigi Malone, Cork. Very nice place, very good food, outdoor seating, very nice and peaceful location when compared to city.
We ordered
vegetarian lasagna: tasty and yum, decent portion;
vegetarian pizza: thin crust, lots of vegetables, served warm;
long island iced tea: the best I have ever had, this was the highlight of the dinner;
nachos and cauliflower on the sides: very very tasty, must order from appetizers, served hot, big portions; and
my friends ordered milk shakes and some juices: they liked it.
Service by the new trainee Anne Marie: top of the order, good to speak to, food served hot in no time, calm composed courteous soft spoken.
Overall, it was a nice dinner and experience, would love to come back again. 5 stars for them
1 star deducted on the account of Manager( i think her name is Paulina). We asked for student discounts and her manager said
1. We dont do student discounts: fair enough;
2. You guys don't look like students: found that bit rude or not a good quality  joke. But then I showed my Student id card to them. Thats why deducted 1 star.
Must go place.
